## Descripción del problema

El objetivo es generar un modelo &lt;b style = 'color:red;'&gt;original, escalable y con lógica de negocio&lt;/b&gt; que permita proponer un **esquema de logística para la repartición de producto proveniente de un Centro de Distribución Regional a lo largo de una semana.** 

**Las restricciones presentadas en el conjunto de datos son las siguientes:**

1. Existencia de **3,625** puntos de demanda de producto. 

2. La **frecuencia de entrega para estos puntos es variable**, variando desde 1 entrega a 3 entregas a la semana. 

3. El **volumen de demanda de producto por parte de las tiendas es variable.** 

4. Las entregas que se lleven a cabo en los distintos centros de distribución deben **estar balanceadas**, es decir, por motivos de logística, las entregas llevadas a cabo a lo largo de la semana tienen que ser lo más similares posible en _distancia recorrida_, _volumen de producto entregado_ y _número de paradas realizadas_.

# Planteamiento del modelo.

* **Primer intento:** Generar un modelo de Programación lineal puro. 

  - (Problema: Muchas restricciones, difícil de computar).
  
* **Segundo intento: ** Generar un modelo de _Machine Learning_ para generar las zonas de reparto. 

  - (Problema: Buena segmentación de los datos, pero mal balanceo)

* &lt;b style = 'color:red;'&gt;Tercer intento:&lt;/b&gt; Mezclar _ML_ con _Programación lineal_. 

  - _**Resultado:** Buen modelo, aprovechando lo mejor de ambos mundos._

# Ventajas del Modelo 

* **Rápido** (tiempo de cálculo de &lt; 2 min).

* **Baja demanda de CPU.**

* Entrenamiento con **mini-batch**

* **Construido con herramientas _Open Source_** (Python: `sklearn`, `pulp`, `pandas`).

* Incorporación de parámetros `\(\epsilon\)` para controlar los márgenes del balanceo.

* Posibilidad de montar en una **aplicación web** o **elaborar un servicio centralizado** para calcular zonas de reparto regionales. 

* Eventualmente, se podría robustecer el modelo incorporando en las _restricciones de programación lineal:_

  * Datos de capacidad y número de camiones repartidores. 
  
  * Datos de almacenamiento en centros de reparto. 
  
  * Ubicación de centros de reparto.
  
  * Cálculo de rutas de calle.
  
  * Clusterizado con **datos socioeconómicos**, etc.
